import React, { Component } from "react";

import "../Mini.css";

//
class MiniMenu extends Component {
  render() {
    return (
      <div className="All-1">
        <h1>Midnight Chill</h1>
        <a className="anchors" href="/"></a>
        <a className="anchors" href="/Rain">
          <img className="gif-1" src={require("../gifs/1.gif")} alt="rain" />
        </a>
        <a className="anchors" href="/Ghibli"></a>
        <a className="anchors" href="/Classical"></a>
      </div>
    );
  }
}

export default MiniMenu;
